import React, { Component } from "react";
import makeStyles from "@material-ui/core/styles/makeStyles";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import CircularProgress from "@material-ui/core/CircularProgress";

class SignUp extends Component {
  state = {
    email: " ",
    password: " ",
    firstName:" ",
    lastName:" ",
    phone:" ",
    DOB:" "
  };
  handleChange = (e) => {
    this.setState({
      [e.target.id]: e.target.value,
    });
  };
  handleSubmit = (e) => {
    e.preventDefault();
    console.log(this.state);
  };
  render() {
    return (
      <Grid container className={classes.form}>
        <Grid item sm />
        <Grid item sm>
          <Typography variant="h3" className={classes.title}>
            Register{" "}
            <span role="img" aria-label="Pizza Emoji">
              🍕
            </span>
          </Typography>
          <form noValidate onSubmit={handleSubmit}>
            <TextField
              id="firstName"
              name="firstName"
              label="FirstName"
              onChange={handleInputChange}
              value={inputs.firstName}
              className={classes.textField}
              helperText={firstNameEmptyError}
              error={firstNameEmptyError ? true : false}
              fullWidth
              required
            />
            <TextField
              id="lastName"
              name="lastName"
              label="LastName"
              onChange={handleInputChange}
              value={inputs.lastName}
              className={classes.textField}
              helperText={lastNameEmptyError}
              error={lastNameEmptyError ? true : false}
              fullWidth
              required
            />
            <TextField
              id="email"
              name="email"
              label="Email"
              onChange={handleInputChange}
              value={inputs.email}
              className={classes.textField}
              fullWidth
              helperText={emailError}
              error={emailError ? true : false}
              required
            />
            <TextField
              id="password"
              name="password"
              type="password"
              label="Password"
              onChange={handleInputChange}
              value={inputs.password}
              className={classes.textField}
              helperText={passwordError}
              error={passwordError ? true : false}
              fullWidth
              required
            />
            <TextField
              id="confirmPassword"
              name="confirmPassword"
              type="password"
              label="Confirm Password"
              onChange={handleInputChange}
              value={inputs.confirmPassword}
              className={classes.textField}
              helperText={passwordError ? passwordError : confirmPasswordError}
              error={passwordError ? true : confirmPasswordError ? true : false}
              fullWidth
              required
            />

            {serverError && (
              <Typography variant="body2" className={classes.customError}>
                {"server error, please try again"}
              </Typography>
            )}

            <Button
              type="submit"
              variant="contained"
              color="primary"
              className={classes.button}
              disabled={loading}
            >
              Sign-up
              {loading && (
                <CircularProgress size={30} className={classes.progress} />
              )}
            </Button>
            <br />
            <small className={classes.small}>
              Already have an account ? Login <Link to="/login">here</Link>
            </small>
          </form>
        </Grid>
        <Grid item sm />
      </Grid>
    );
  }
}

export default SignUp;
